import React from 'react';

class Message extends React.Component{
    constructor() {
        super();
        this.state = {
            errorMessage: '',
            page: ''
        }

        this.changePage = this.changePage.bind(this);

    }

    changePage =  (page) => {
        this.setState({
            page: page
        })
    }

    render() {

        const page =
            <div className="row">
                <div className="col-4 border" style={{height: "88.5vh"}}>
                </div>
                <div className='col-8 border border-warning'>
                </div>
            </div>

        return (page);
    }
}

export default Message;
